import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Text style={styles.titulo1}>Seja bem vindx ao App CuidaBicho!</Text>
      <Text style={styles.texto_normal}> Nosso objetivo é construir uma rede colaborativa de amigos dos bichamos. Medicamentos que seu bichinho não irá mais precisar ou outros materiais que possam ser úteis para outras famílias. </Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',

  },
  texto_normal: {
    fontSize: 14 ,
    justifyContent: 'center',
    color: '#444',
  },
  titulo1: {
    fontSize: 18 ,
